import React from 'react'
import { CloseIcon, DropdownContainer, Icon, DropdownWrapper, DropdownMenu, DropdownLink, DropdownBtnWrap, IconFB, IconInsta, DropdownRoute} from './dropdownElements';
import Resume from '../../pages//resume/index.js';
import Portfolio from '../../pages/portfolio/portfolio';
import Contact from '../../pages/contact/contact';
import Services from '../../pages/services';

export const Dropdown = ({toggle, isOpen}) => {
    return (
        <DropdownContainer isOpen={isOpen} onClick={toggle}>
            <Icon onClick={toggle}>
                <CloseIcon />
            </Icon>

            <DropdownWrapper>
                <DropdownMenu>
                    <DropdownRoute to="/" onClick={toggle}> Home</DropdownRoute>
                    <DropdownRoute to= {Resume} onClick={toggle} activeStyle exact> Resume</DropdownRoute>
                    <DropdownRoute to="/portfolio" onClick={toggle} activeStyle> Portfolio</DropdownRoute>
                    <DropdownRoute to="/contact" onClick={toggle} activeStyle> Contact</DropdownRoute>
                </DropdownMenu>

                <DropdownBtnWrap>           
                    <IconFB />
                    <IconInsta/>
                </DropdownBtnWrap>
            </DropdownWrapper>

        </DropdownContainer>
    );
};

export default Dropdown;
